import Input from "../Input/Input";
import './form.scss';
function Form(props) {
    return (
        <div className="Form">
        <form>
            <div className="Group">

                <Input inp = {props.inp1} />
                <Input inp = {props.inp2} />
                <Input inp = {props.inp3} style/>

            </div>

            <button>Submit</button>
        </form>
        </div>
    );
}

export default Form
